<script type="text/javascript">
jQuery(document).ready(function($) {
  $('#discover').click(function() {
    $('html, body').animate({
      scrollTop: $('#about').offset().top
    }, 500); // Duration of the scroll (in milliseconds)
  });
  $('#contact-us-button').click(function() {
        $('html, body').animate({
        scrollTop: $('#contact-us').offset().top
        }, 500, function() {
            // Add #contact-us to the URL without reloading the page
            window.history.pushState(null, null, '#contact-us');
        });
    });
  // Function to set the active class
  function setActiveMenuItem() {
        var currentPath = window.location.pathname;
        var foundActive = false;

        console.log(currentPath)

        $('#menu-list li a').each(function() {
            var href = $(this).attr('href');
            
            // Check if the current path matches the href of the link
            if (currentPath === href || (currentPath === '/' && href === '/home')) {
                $(this).parent().addClass('active');
                foundActive = true;
            }
        });

        // If no menu item matches, default to the first one (Home)
        if (!foundActive) {
            $('#menu-list li:first').addClass('active');
        }
    }

    // Set active class on page load
    setActiveMenuItem();

    // Set active class on click
    $('#menu-list li a').on('click', function() {
        $('#menu-list li').removeClass('active');
        $(this).parent().addClass('active');
    });

    // form validation 
    document.getElementById('myForm').addEventListener('submit', function(event) {
    // Get form fields
    var name = document.getElementById('name').value.trim();
    var email = document.getElementById('email').value.trim();

    // Regular expression for validating email
    var emailPattern = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;

    // Validation flag
    var valid = true;

    // Clear previous error messages
    var errorMessages = document.querySelectorAll('.error');
    errorMessages.forEach(function(msg) {
        msg.remove();
    });

    // Name validation
    if (name === "") {
        showError('name', 'Please enter your name.');
        valid = false;
    }

    // Email validation
    if (email === "") {
        showError('email', 'Please enter your email.');
        valid = false;
    } else if (!emailPattern.test(email)) {
        showError('email', 'Please enter a valid email address.');
        valid = false;
    }

    // If form is not valid, prevent submission
    if (!valid) {
        event.preventDefault();
    }
    });

    function showError(elementId, message) {
        var element = document.getElementById(elementId);
        var error = document.createElement('div');
        error.className = 'error';
        error.style.color = 'red';
        error.innerText = message;
        element.parentNode.appendChild(error);
    }
});

window.addEventListener('load', function () {
        const preloader = document.getElementById('custom-preloader');
        setTimeout(function() {
          preloader.classList.add('preloader-hidden');
        }, 1500); 
    });

</script>
